            <img className={"header-logo"} src={logo} alt="Little Lemon Logo" width={"200px"} height={"96px"}/>
            <Nav section={"top-bar"} links={
                [
                    {to: "/", label: "Home", anchor: "CallToAction"},
                    {to: "/about", label: "About", anchor: "Chicago"},
                    {to: "/menu", label: "Menu", anchor: ""},
                    {to: "/booking", label: "Reservations"},
                    {to: "/order-online", label: "Order Online"},
                    {to: "/login", label: "Login"}
                ]
            } />
        </header>
    )
}

